        super(props);
        this.state = {
            filters: {
                name:"filter"
            }
        }
    }

    getFilters = () => {
        return this.state;
    }

    setFilter = (filter,prop) => {
        this.setState({
            [filter]: prop
        })
    }

    render(){
        return(
            <SearchResult ></SearchResult>
        )
